import { h } from "hyperapp"

function vnode(tag) {
  return function (props, children) {
    return typeof props === "object" && !Array.isArray(props)
      ? h(tag, props, children)
      : h(tag, {}, props)
  }
}


export function a(props, children) {
  return vnode("a")(props, children)
}

